import React, { useEffect, useState } from "react";
import "./Video.css"
import Cardsm from "../../components/Card/Cardsm";
import Comments from "../../components/Comments/Comments";
import ThumbUpOutlinedIcon from '@mui/icons-material/ThumbUpOutlined';
import ThumbDownOutlinedIcon from '@mui/icons-material/ThumbDownOutlined';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';
import ThumbDownAltIcon from '@mui/icons-material/ThumbDownAlt';
import ReplyIcon from '@mui/icons-material/Reply';
import ContentCutIcon from '@mui/icons-material/ContentCut';
import img from "../../images/i.jpg"
import { useDispatch, useSelector } from "react-redux";
import { useLocation } from "react-router-dom";
import axios from "axios";
import { fetchSuccess } from "../../components/redux/videoSlice.js";
import TimeAgo from 'javascript-time-ago'
import en from 'javascript-time-ago/locale/en.json'
import ru from 'javascript-time-ago/locale/ru.json'
import ReactTimeAgo from 'react-time-ago'
TimeAgo.addDefaultLocale(en)
TimeAgo.addLocale(ru)
const Video = () => {
  const {currentUser} = useSelector((state)=>state.user);
  const {currentVideo} = useSelector((state)=>state.video);
  const dispatch = useDispatch();
  const path = useLocation().pathname.split("/")[2];
  console.log(path);
  const [channel,setChannel] = useState({})

  useEffect(()=>{
    const fetchdata = async()=>{
      try {
        const videores = await axios.get(`/video/find/${path}`)
        console.log(videores.data)
        const channelres = await axios.get(`/user/find/${videores.data.userId}`)
        setChannel(channelres.data);
        console.log("1")
        dispatch(fetchSuccess(videores.data))
        console.log(currentVideo)
        console.log(currentVideo.title)
      } catch (error) {
        
      }
      }
      fetchdata();
  },[path,dispatch])
  return (
    <div className="video_cont">
      <div className="video_content">
        <div className="video_wrapper">
        <iframe
            width="100%"
            height="720"
            src="https://www.microsoft.com/en-us/videoplayer/embed/RWfzeB?pid=ocpVideo1-innerdiv-oneplayer&maskLevel=20&market=en-us"
            title="YouTube video player"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
          ></iframe>
          <div className="title">{currentVideo.title}</div>
          <div className="details">
            <div className="info"> {currentVideo.views} views • <ReactTimeAgo date={currentVideo.createdAt} locale="en-US"/></div>
            <button className="video_button video_class">
                <button className="video_button">
                {currentVideo.likes?.includes(currentUser?._id) ? (
                <ThumbUpIcon />
              ) : (
                <ThumbUpOutlinedIcon />
              )}{" "}
                  {currentVideo.likes?.length}
                 
                  </button>
                <button className="video_button">
                  <ThumbDownAltIcon/>Dislike</button>
                <button className="video_button">
                  <ReplyIcon/>
                  Share</button>
                <button className="video_button">
                  <ContentCutIcon/>
                  Save</button>
            </button>
          </div>
          <hr/>
          <div className="channel">
            <div className="channelinfo">
                <img className="card_channelImg" src={channel.img} alt=".."></img>
                <div className="channeldetail">
                <div className="channelname">{channel.name}</div>
                <div className="channelcounter">{channel.subscribers} subscribers</div>
                <div className="description">
                  {currentVideo.desc}
                </div>
            </div>
            </div>
            <div className="subscribe">subscribe</div>
          </div>
          <hr/>
          <Comments/>
        </div>
      </div>
      <div className="recommandation">
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
       <Cardsm/>
      </div>
    </div>
  );
};

export default Video;
